import React from 'react';
import {Breadcrumb, BreadcrumbItem,Carousel} from 'reactstrap';
import {Link} from 'react-router-dom';
import {baseurl} from '../shared/baseurl';


function Work(props) {

    if(props.work.isLoading){
        return(
            <div className="container">
                <div className="row">
                    LOADING....
                </div>
            </div>
        );
    }
    else if(props.work.errmess){
        return(
            <div className="container">
                <div className="row">
                    {props.errmess}
                </div>
            </div>
        );
    }
    else if(props.work.work){
        const workImg = props.work.work.map((w) => {
            return(
                <Carousel.Item>
                <img
                  className="d-block w-100"
                  src="{baseurl + w.image}"
                  alt="First slide"
                />
                <Carousel.Caption>
                  <h3>First slide label</h3>
                  <p>Nulla vitae elit libero, a pharetra augue mollis interdum.</p>
                </Carousel.Caption>
              </Carousel.Item>
                             
            );
        })

        return(
            <div className="container">
                <div className="row mt-2">
                    <Breadcrumb>
                        <BreadcrumbItem><Link to="/home">Home</Link></BreadcrumbItem>
                        <BreadcrumbItem active>That's How We Work</BreadcrumbItem>
                    </Breadcrumb>       
                </div>
                <div className="row">
                    <h1 className="siteTextColor">That is how we work</h1>
                </div>
                <div className="row">
                    <div id="carouselExampleControls" className="carousel slide" data-ride="carousel">
                        <Carousel>
                            {workImg}
                        </Carousel>                    
                    </div>
                </div>                    
            </div>
        );
    }
    else {
        return(
            <div></div>
        );
    }
}

export default Work;
